using ShineEngine;

/// <summary>
/// 拍卖行物品记录数据(generated by shine)
/// </summary>
public class AuctionItemRecordData:BaseData
{
	/// <summary>
	/// 物品id
	/// </summary>
	public int id;
	
	/// <summary>
	/// 数据类型ID
	/// </summary>
	public const int dataID=BaseDataType.AuctionItemRecord;
	
	/// <summary>
	/// 当前价格
	/// </summary>
	public int price;
	
	/// <summary>
	/// 天数记录组
	/// </summary>
	public SQueue<CountData> days;
	
	public AuctionItemRecordData()
	{
		_dataID=BaseDataType.AuctionItemRecord;
	}
	
	/// <summary>
	/// 获取数据类名
	/// </summary>
	public override string getDataClassName()
	{
		return "AuctionItemRecordData";
	}
	
	/// <summary>
	/// 读取字节流(完整版)
	/// </summary>
	protected override void toReadBytesFull(BytesReadStream stream)
	{
		stream.startReadObj();
		
		this.id=stream.readInt();
		
		this.price=stream.readInt();
		
		int daysLen=stream.readLen();
		if(this.days!=null)
		{
			this.days.clear();
			this.days.ensureCapacity(daysLen);
		}
		else
		{
			this.days=new SQueue<CountData>();
		}
		
		SQueue<CountData> daysT=this.days;
		for(int daysI=daysLen-1;daysI>=0;--daysI)
		{
			CountData daysV;
			BaseData daysVT=stream.readDataFullNotNull();
			if(daysVT!=null)
			{
				if(daysVT is CountData)
				{
					daysV=(CountData)daysVT;
				}
				else
				{
					daysV=new CountData();
					if(!(daysVT.GetType().IsAssignableFrom(typeof(CountData))))
					{
						stream.throwTypeReadError(typeof(CountData),daysVT.GetType());
					}
					daysV.shadowCopy(daysVT);
				}
			}
			else
			{
				daysV=null;
			}
			
			daysT.offer(daysV);
		}
		
		stream.endReadObj();
	}
	
	/// <summary>
	/// 写入字节流(完整版)
	/// </summary>
	protected override void toWriteBytesFull(BytesWriteStream stream)
	{
		stream.startWriteObj();
		
		stream.writeInt(this.id);
		
		stream.writeInt(this.price);
		
		if(this.days!=null)
		{
			stream.writeLen(this.days.size());
			if(!this.days.isEmpty())
			{
				CountData[] daysVValues=this.days.getValues();
				int daysVMark=this.days.getMark();
				int daysVStart=this.days.getStart();
				for(int daysVI=0,daysVLen=this.days.length();daysVI<daysVLen;++daysVI)
				{
					CountData daysV=daysVValues[(daysVI+daysVStart)&daysVMark];
					if(daysV!=null)
					{
						stream.writeDataFullNotNull(daysV);
					}
					else
					{
						nullObjError("daysV");
					}
					
				}
			}
		}
		else
		{
			nullObjError("days");
		}
		
		stream.endWriteObj();
	}
	
	/// <summary>
	/// 读取字节流(简版)
	/// </summary>
	protected override void toReadBytesSimple(BytesReadStream stream)
	{
		this.id=stream.readInt();
		
		this.price=stream.readInt();
		
		int daysLen=stream.readLen();
		if(this.days!=null)
		{
			this.days.clear();
			this.days.ensureCapacity(daysLen);
		}
		else
		{
			this.days=new SQueue<CountData>();
		}
		
		SQueue<CountData> daysT=this.days;
		for(int daysI=daysLen-1;daysI>=0;--daysI)
		{
			CountData daysV;
			daysV=(CountData)stream.readDataSimpleNotNull();
			
			daysT.offer(daysV);
		}
		
	}
	
	/// <summary>
	/// 写入字节流(简版)
	/// </summary>
	protected override void toWriteBytesSimple(BytesWriteStream stream)
	{
		stream.writeInt(this.id);
		
		stream.writeInt(this.price);
		
		if(this.days!=null)
		{
			stream.writeLen(this.days.size());
			if(!this.days.isEmpty())
			{
				CountData[] daysVValues=this.days.getValues();
				int daysVMark=this.days.getMark();
				int daysVStart=this.days.getStart();
				for(int daysVI=0,daysVLen=this.days.length();daysVI<daysVLen;++daysVI)
				{
					CountData daysV=daysVValues[(daysVI+daysVStart)&daysVMark];
					if(daysV!=null)
					{
						stream.writeDataSimpleNotNull(daysV);
					}
					else
					{
						nullObjError("daysV");
					}
					
				}
			}
		}
		else
		{
			nullObjError("days");
		}
		
	}
	
	/// <summary>
	/// 复制(潜拷贝)
	/// </summary>
	protected override void toShadowCopy(BaseData data)
	{
		if(!(data is AuctionItemRecordData))
			return;
		
		AuctionItemRecordData mData=(AuctionItemRecordData)data;
		
		this.id=mData.id;
		this.price=mData.price;
		this.days=mData.days;
	}
	
	/// <summary>
	/// 复制(深拷贝)
	/// </summary>
	protected override void toCopy(BaseData data)
	{
		if(!(data is AuctionItemRecordData))
			return;
		
		AuctionItemRecordData mData=(AuctionItemRecordData)data;
		
		this.id=mData.id;
		
		this.price=mData.price;
		
		if(mData.days!=null)
		{
			if(this.days!=null)
			{
				this.days.clear();
				this.days.ensureCapacity(mData.days.size());
			}
			else
			{
				this.days=new SQueue<CountData>();
			}
			
			SQueue<CountData> daysT=this.days;
			if(!mData.days.isEmpty())
			{
				CountData[] daysVValues=mData.days.getValues();
				int daysVMark=mData.days.getMark();
				int daysVStart=mData.days.getStart();
				for(int daysVI=0,daysVLen=mData.days.length();daysVI<daysVLen;++daysVI)
				{
					CountData daysV=daysVValues[(daysVI+daysVStart)&daysVMark];
					CountData daysU;
					if(daysV!=null)
					{
						daysU=(CountData)daysV.clone();
					}
					else
					{
						daysU=null;
						nullObjError("daysU");
					}
					
					daysT.offer(daysU);
				}
			}
		}
		else
		{
			this.days=null;
			nullObjError("days");
		}
		
	}
	
	/// <summary>
	/// 是否数据一致
	/// </summary>
	protected override bool toDataEquals(BaseData data)
	{
		AuctionItemRecordData mData=(AuctionItemRecordData)data;
		if(this.id!=mData.id)
			return false;
		
		if(this.price!=mData.price)
			return false;
		
		if(mData.days!=null)
		{
			if(this.days==null)
				return false;
			if(this.days.size()!=mData.days.size())
				return false;
			SQueue<CountData> daysT=this.days;
			SQueue<CountData> daysR=mData.days;
			int daysLen=daysT.size();
			for(int daysI=0;daysI<daysLen;++daysI)
			{
				CountData daysU=daysT.get(daysI);
				CountData daysV=daysR.get(daysI);
				if(daysV!=null)
				{
					if(daysU==null)
						return false;
					if(!daysU.dataEquals(daysV))
						return false;
				}
				else
				{
					if(daysU!=null)
						return false;
				}
				
			}
		}
		else
		{
			if(this.days!=null)
				return false;
		}
		
		return true;
	}
	
	/// <summary>
	/// 转文本输出
	/// </summary>
	protected override void toWriteDataString(DataWriter writer)
	{
		writer.writeTabs();
		writer.sb.Append("id");
		writer.sb.Append(':');
		writer.sb.Append(this.id);
		
		writer.writeEnter();
		writer.writeTabs();
		writer.sb.Append("price");
		writer.sb.Append(':');
		writer.sb.Append(this.price);
		
		writer.writeEnter();
		writer.writeTabs();
		writer.sb.Append("days");
		writer.sb.Append(':');
		writer.sb.Append("Queue<CountData>");
		if(this.days!=null)
		{
			SQueue<CountData> daysT=this.days;
			int daysLen=daysT.size();
			writer.sb.Append('(');
			writer.sb.Append(daysLen);
			writer.sb.Append(')');
			writer.writeEnter();
			writer.writeLeftBrace();
			for(int daysI=0;daysI<daysLen;++daysI)
			{
				CountData daysV=daysT.get(daysI);
				writer.writeTabs();
				writer.sb.Append(daysI);
				writer.sb.Append(':');
				if(daysV!=null)
				{
					daysV.writeDataString(writer);
				}
				else
				{
					writer.sb.Append("CountData=null");
				}
				
				writer.writeEnter();
			}
			writer.writeRightBrace();
		}
		else
		{
			writer.sb.Append("=null");
		}
		
		writer.writeEnter();
	}
	
	/// <summary>
	/// 初始化初值
	/// </summary>
	public override void initDefault()
	{
		this.days=new SQueue<CountData>();
	}
	
	/// <summary>
	/// 回池
	/// </summary>
	protected override void toRelease(DataPool pool)
	{
		this.id=0;
		this.price=0;
		this.days=null;
	}
	
}
